  return (
    <View>
      <TextInput text={item.label} onEndEditing={(text) => console.log('upper onEndEditing', text)}/>
      <TextInput text={item.label} onEndEditing={(text) => console.log('lower onEndEditing', text)}/>
    </View>)
}
